class User:
    def __init__(self, user_type):
        self.user_type = user_type

class Submission:
    def __init__(self, agency_user, status):
        self.agency_user = agency_user
        self.status = status
        self.errors = []

    def validate(self):
        # Example validation logic
        if not self.agency_user:
            self.errors.append("Agency user is required.")
        if self.status not in ["draft", "submitted", "published"]:
            self.errors.append("Invalid submission status.")
        return len(self.errors) == 0

class AgencyUser(User):
    def __init__(self, name):
        super().__init__('Agency')
        self.name = name

    def submit(self, submission):
        if submission.validate():
            submission.status = "submitted"
            return True
        return False

class Developer(User):
    def __init__(self, name):
        super().__init__('Developer')
        self.name = name

    def update_validation_rule(self, rule):
        print(f"Updating validation rule: {rule}")

    def log_issue(self, submission_id, issue):
        print(f"Issue logged for submission {submission_id}: {issue}")

class UI_Designer(User):
    def __init__(self, name):
        super().__init__('UI Designer')
        self.name = name

    def redesign_page(self, page_name):
        print(f"Redesigning {page_name} page to match new styles.")

    def track_issues(self, issues):
        print(f"Tracking issues: {issues}")

class BrokerUser(User):
    def __init__(self, name):
        super().__init__('Broker')
        self.name = name

    def upload_file(self, file_path):
        print(f"Uploading file: {file_path}")

    def validate_submission(self, submission):
        if submission.validate():
            print(f"Submission for {self.name} is valid.")
        else:
            print(f"Submission for {self.name} has errors: {submission.errors}")

class FABSUser(User):
    def __init__(self, name):
        super().__init__('FABS')
        self.name = name

    def download_file(self, file_path):
        print(f"Downloading FABS file: {file_path}")

class System:
    def __init__(self):
        self.submissions = []
        self.validation_rules = []

    def add_submission(self, submission):
        self.submissions.append(submission)

    def update_validation_rule(self, rule):
        self.validation_rules.append(rule)

    def process_submissions(self):
        for submission in self.submissions:
            if not submission.validate():
                print(f"Errors in submission: {submission.errors}")
            else:
                print(f"Processing submission with status: {submission.status}")

def main():
    # Create users
    agency_user = AgencyUser("AgencyUser1")
    developer = Developer("Dev1")
    ui_designer = UI_Designer("UIDesigner1")
    broker_user = BrokerUser("BrokerUser1")
    fabs_user = FABSUser("FABSUser1")

    # Create a submission
    submission = Submission(agency_user, "draft")

    # Validate and submit
    if agency_user.submit(submission):
        print(f"{agency_user.name} submitted successfully.")
    else:
        print(f"{agency_user.name} could not submit: {submission.errors}")

    # Developer updates validation rule
    developer.update_validation_rule("New Rule for FABS submission.")

    # UI designer redesigns page
    ui_designer.redesign_page("Resources")

    # Broker user uploads file
    broker_user.upload_file("submission_file.txt")

    # FABS user downloads file
    fabs_user.download_file("fabs_file.txt")

    # Process submissions in system
    system = System()
    system.add_submission(submission)
    system.process_submissions()

if __name__ == "__main__":
    main()
